import * as React from 'react';
import JohnZoscak from '../images/John-Zoscak.png';

const Header = (props) => {
  return (
    <header>
      <div className='header'>
        <img src={JohnZoscak} alt='John Zoscak' />
      </div>
    </header>
  );
}
export default Header;
